import React from "react";
import { Card, Button } from "react-bootstrap";

const ProjectSummaryDashboard = () => {
  return (
    <Container>
      <Card style={{ width: "100%" }}>
        <Card.Header as="h4">
          MARSVIEW.AI
          <Button
            variant="success"
            className="dropdown float-end"
            id="addProject"
            onClick={handleShow}
          >
            + Add
          </Button>
          <Card.Text className="float-end">&nbsp;</Card.Text>
          <Button
            variant="danger"
            className="float-end"
            id="deleteProjects"
            disabled={true}
          >
            Delete Selected
          </Button>
        </Card.Header>
        <Card.Body>
        </Card.Body>
      </Card>
    </Container>
  );
};

export default ProjectSummaryDashboard;
